import React from 'react'
import { useFood } from '../context'


const CartItems = () => {

    const { food_list , cartItems } = useFood();
    console.log(cartItems);

  return (
    <div className=' pt-10' >
        <div>
            <div>Items</div>
            <div>Title</div>
            <div>Price</div>
            <div>Quantity</div>
            <div>Total</div>
            <div>Remove</div>
        </div>
        {
            food_list.map( (food ) => {
                if( cartItems[food._id] > 0 ){
                    return (
                        <div className='grid grid-cols-6' >
                            <img src={food.image} />
                            <div>{food.name}</div>
                            <div>${food.price}</div>
                            <div>{cartItems[food._id]}</div>
                            <div>${food.price*cartItems[food._id]}</div>
                            <div></div>
                        </div>
                    )
                }    
            })
        }
    </div>
  )
}

export default CartItems
